import './Rank.scss';
import React from "react";
import ListView from './ListView';

function Rank() {
  return (
    <div className="Rank">
      <div>
      <div class="fact-box"></div>
      <div class="conv-box"></div>
      <div class="false-box"></div>
      </div>

      <ListView />
    </div>
  );
}

export default Rank;
